import React from 'react';
import '../App.css';
import { Button } from './Button';
import './HeroSection.css';

function HeroSection() {
  return (
    <div className = 'hero-container'>
      <image src={'src\images\img-1.jpg'} alt="Hero Image" />
      <h1>Hello</h1>
      <p>I am Jason</p>
      <div>
        <h2 className = 'body-text'>
          This is my first time coding in HTML, CSS and using React ! I'm super excited to experiment and work with this platform as I'm normally used to working in backend frameworks
        </h2>
      </div>
    </div>
  );
}

export default HeroSection;
